Nature, Travel Documentary hosted by Monty Don, published by BBC in 2011 - English narration


Information
------------------------------

Around The World In 80 Gardens 
Around the World in 80 Gardens is a BBC series that follows broadcaster Monty Don as he travels all over the planet searching for world-class gardens - ancient and modern, large and small, grand and humble. In total, exactly eighty gardens are featured during his 10 journeys, and include the Alhambra, the gardens of the Taj Mahal in India, the gardens of the Villa D'Este in Italy and many important botanic and royal gardens from Thailand to Bali, from New Zealand to Europe and from China to Mexico.




6)  China and Japan 
Monty Don visits the world's 80 most inspiring gardens, this time in China and Japan, two of the world's oldest gardening cultures. In China he visits the ancient scholars' gardens of Suzhou and the awesome Yellow Mountains of Huangshang that inspired them. He visits the Imperial Summer Palace Gardens of Beijing. In Kyoto, Japan's city of gardens, he tries to understand the Zen garden.



